import React from 'react';

function EmailEditor({ subject, content, onSubjectChange, onContentChange }) {
  return (
    <div>
      <label>Subject: </label>
      <input type="text" value={subject} onChange={(e) => onSubjectChange(e.target.value)} />
      <br />
      <label>Email Content: </label>
      <textarea value={content} onChange={(e) => onContentChange(e.target.value)} />
    </div>
  );
}

export default EmailEditor;
